import React from "react";
import './PostComponent_style.tsx';
import { PostWrapper } from "./PostComponent_style";

interface Props {
    name?: string;
    image?: string;
    likes?: number;
}

export const PostComponent: React.FC<Props> = (Props) => {
    return(
        <PostWrapper>
            <div id="container">
                <div>Posts</div>
                <div id="name">{Props.name}</div>
                <img id="image" src={"./public/" + Props.image} alt="">image/video</img>
                <div id="like">Like Button {Props.likes}</div>
            </div>
        </PostWrapper>
    )

}

export default PostComponent;
